16.body:
To define a function and assign it to a variable, the syntax is as follows: # Define a parameterless function named `say-hello` that prints "Hello"
[$say-hello] { Hello
} # Define a function `greet` with parameter `name` that prints a custom greeting
[$greet: name] { Hello, <name>!
} # Define a function `flip-coin` that returns the value of either `heads` and `tails`
[$flip-coin: heads; tails] { {<heads>|<tails>}
}

19.body:
Calling an anonymous function uses the same syntax as regular function calls, but the function name is replaced by the ! operator followed by an expression that resolves to the function you want to call. # Define a function that returns a parameterless box
[$get-anon-func] { []{Hello from anonymous function}
} [![get-anon-func]] # "Hello from anonymous function" # Define a function that returns a box with a single parameter
[$get-greet-func] { [[name]]{Hello, <name>!}
} [![get-greet-func]:Rant] # "Hello, Rant!"

