Lists are editable arrays. Lists may contain multiple types of values. A list is created by placing the list operator @ before a block containing the contents of the list. # Create an empty list
<$empty-list = @{}> # Create a list of numbers
<$lucky-numbers = @{1|2|3|5|7|11|13}> # Create a list of lists
<$important-letters = @{ @{A|B|C} | @{D|E|F}
}>

